import React, { useEffect, useState } from 'react';
import { BrowserRouter as Router, Route, Link, Switch, useNavigate } from 'react-router-dom';
import './App.css';

function App() {
    const [data, setData] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        fetchData();
    }, []);

    const fetchData = () => {
        fetch('http://localhost:25000/data')
            .then(response => response.json())
            .then(data => setData(data))
            .catch(error => console.error("Erro ao buscar os dados:", error));
    };

    const handleEdit = (carId) => {
        navigate(`/edit/${carId}`);
    };

    const handleAdd = () => {
        navigate('/add');
    };

    return (
        <div className="App">
            <h1>Car List</h1>
            <button onClick={handleAdd}>Adicionar Carro</button>
            <table>
                <thead>
                    <tr>
                        <th>Modelo</th>
                        <th>Marca</th>
                        <th>Ano</th>
                        <th>Categoria</th>
                        <th>Disponibilidade</th>
                        <th>Ações</th> {/* Nova coluna para ações */}
                    </tr>
                </thead>
                <tbody>
                    {Array.isArray(data) && data.map(car => (
                        <tr key={car.id}>
                            <td>{car.modelo}</td>
                            <td>{car.marca}</td>
                            <td>{car.ano}</td>
                            <td>{car.categoria}</td>
                            <td>{car.disponibilidade ? 'Disponível' : 'Indisponível'}</td> 
                            <td>
                                <button onClick={() => handleEdit(car.id)}>Editar</button> {/* Botão de editar */}
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default App;
